export function moduleData(){return{props:{returnData:Function,value:[String,Object],args:Object},data:function(){return{option:this.value}},watch:{option:{handler(t,e){this.returnData(t)},deep:!0},value:{handler(t,e){this.option=this.value},deep:!0}},methods:{logChange(){this.returnData(this.option)}},template:'    <div class="uip-flex">      <select @change="logChange()" class="uip-input-small uip-padding-top-xxxs uip-padding-bottom-xxxs uip-max-w-100p  uip-w-100p" style="padding-top:2px;padding-bottom:2px" v-model="option">        <template v-for="item in args.options">          <option :value="item.value">{{item.label}}</option>        </template>      </select>    </div>'}};